def binärstr(xltx_base64):
    # Bytes zu String konvertieren (falls nötig)
    if isinstance(xltx_base64, bytes):
        b64str = xltx_base64.decode()
    else:
        b64str = xltx_base64

    # Leerzeichen entfernen
    b64str = b64str.replace('\n', '').replace('\r', '')

    # Padding ergänzen, falls nötig, weil xls_base64 nicht als Zeilenstring vorliegt
    missing_padding = len(b64str) % 4
    if missing_padding:
        b64str += '=' * (4 - missing_padding)

    return b64str
